import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [username, setUsername] = useState('');
  const [language, setLanguage] = useState('C++');
  const [stdin, setStdin] = useState('');
  const [sourceCode, setSourceCode] = useState('');
  const [entries, setEntries] = useState([]);

  useEffect(() => {
    fetchEntries();
  }, []);

  const fetchEntries = () => {
    axios.get('/entries')
      .then(response => {
        setEntries(response.data);
      })
      .catch(error => {
        console.error('Error fetching data: ', error);
      });
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    const formData = {
      username,
      language,
      stdin,
      sourceCode
    };

    axios.post('/submit', formData)
      .then(response => {
        console.log(response.data);
        // Optionally show success message
        // Clear form fields
        setUsername('');
        setLanguage('C++');
        setStdin('');
        setSourceCode('');
        // Fetch updated entries
        fetchEntries();
      })
      .catch(error => {
        console.error('Error submitting data: ', error);
        // Optionally show error message
      });
  };

  return (
    <div>
      <h1>Code Snippet Submission</h1>
      <form onSubmit={handleSubmit}>
        <label>Username: </label>
        <input type="text" value={username} onChange={e => setUsername(e.target.value)} required /><br />
        <label>Preferred Language: </label>
        <select value={language} onChange={e => setLanguage(e.target.value)}>
          <option value="C++">C++</option>
          <option value="Java">Java</option>
          <option value="JavaScript">JavaScript</option>
          <option value="Python">Python</option>
        </select><br />
        <label>Standard Input: </label>
        <input type="text" value={stdin} onChange={e => setStdin(e.target.value)} /><br />
        <label>Source Code: </label>
        <textarea value={sourceCode} onChange={e => setSourceCode(e.target.value)} required /><br />
        <button type="submit">Submit</button>
      </form>
      <hr />
      <h2>Submitted Entries</h2>
      <table>
        <thead>
          <tr>
            <th>Username</th>
            <th>Language</th>
            <th>Stdin</th>
            <th>Source Code (First 100 chars)</th>
            <th>Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {entries.map((entry, index) => (
            <tr key={index}>
              <td>{entry.username}</td>
              <td>{entry.language}</td>
              <td>{entry.stdin}</td>
              <td>{entry.source_code_short}</td>
              <td>{entry.timestamp}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
